import React from 'react';
import Header from './components/Header'
import Images from './components/Images'
import Container from 'react-bootstrap/Container'


class App extends React.Component{

  render(){
    return (
        <Container>
            <Header />
            <Images />
        </Container>
    );
  }
}

export default App;
